import React, { useState } from 'react';
import axios from "axios";


const Homes = ()=> {
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')
    const [username,setUsername] = useState('')

    const submit = async (e)=>{
        e.preventDefault()
        try {
            await axios.post("http://localhost:4000/users/signup",{email,password,username})
        }catch(e){
            console.log(e);
        }
    }

    return (
        <div>
        <form action="POST">
        <textarea name="text" onChange={(e)=>{setEmail(e.target.value)}}></textarea>
        <textarea name="text" onChange={(e)=>{setPassword(e.target.value)}}></textarea>
        <textarea name="text" onChange={(e)=>{setUsername(e.target.value)}}></textarea>
       <input type="submit" onClick={submit} value="submit" />
       </form>
        </div>
    )
}

export default Homes;
